import logo from './logo.svg';
import './App.css';
import { Route } from 'react-router-dom';
import homepage from './components/homepage/home';
import Menu from './components/menu/menu';


function App() {
  return (
    <div>
        <Menu/>
        <Route path='/home'>
        <homepage/>
      </Route>
    </div>
  );
}

export default App;
